import React from "react";
import { Card } from "react-bootstrap";

const UserList = (props) => {
  const { user } = props;
  return (
    <div>
      <small style={{ textAlign: "center" }}>User name are following</small>
      {user ? (
        <Card style={{ marginTop: "30px", textAlign: "center" }}>{user}</Card>
      ) : null}
    </div>
  );
};

export default UserList;
